import React from 'react'
import './progressbar.css'

const ProgressBar = () => {
  window.onload = () => {
    var checkbar = [true, true, true, true, true]
    var subjpercent = [78, 85, 80, 75, 80]
    if (document.getElementById("main-Box-of-Website")) {
      document.getElementById("main-Box-of-Website").addEventListener("scroll", () => {
        for (var bar = 0; bar < 5; bar++) {
          var browserarea = document.getElementById("myProgress" + bar).getBoundingClientRect()
          if (checkbar[bar]) {
            if (Number(browserarea.bottom) < 725 && Number(browserarea.top) > 412) {
              progressbarWidth(subjpercent[bar], 0, bar)
              checkbar[bar] = false;
            }
          }
        }
      })
    }
  }


  function progressbarWidth(progressvalue, i, bar) {
    if (i === 0) {
      i = 1;
      var elem = document.getElementById("myBar" + bar);
      var perecentageshowingspan = document.getElementById("mybarspan" + bar);
      var width = 1;
      var id = setInterval(frame, 7);
      function frame() {
        if (width >= progressvalue) {
          clearInterval(id);
          i = 0;
        } else {
          width++;
          elem.style.width = width + "%";
          perecentageshowingspan.innerHTML = width * 1 + "%";
        }
      }
    }
  }

  return (
    <div id="main-Box-of-Website">
      

      <div id="progressBar">
        <p>Python 3</p>
        <div id="myProgress0" >
          <div id="myBar0"><span id="mybarspan0">0%</span></div>
        </div>
    
       
        <p>Git</p>
        <div id="myProgress1" >
          <div id="myBar1"><span id="mybarspan1">0%</span></div>
        </div>
  

        <p>Javascript</p>
        <div id="myProgress2" >
          <div id="myBar2"><span id="mybarspan2">0%</span></div>
        </div>


        <p>HTML/CSS</p>
        <div id="myProgress3" >
          <div id="myBar2"><span id="mybarspan3">0%</span></div>
        </div>
        
        
        
        <p>SQL</p>
        <div id="myProgress4" >
          <div id="myBar3"><span id="mybarspan4">0%</span></div>
        </div>
        

        
        <p>C/C++</p>
        <div id="myProgress5" >
          <div id="myBar4"><span id="mybarspan5">0%</span></div>
        </div>
        
        
      </div>



    </div>
  )
}

export default ProgressBar;
